function menuDropdown(){for(var e=document.getElementsByClassName("main__sidebar__menu-item-controller"),t=0;t<e.length;t++){let n=e[t];n.addEventListener("click",function(e){var t=e.target;n.contains(t)&&(n.parentElement.classList.contains("active")?n.parentElement.classList.remove("active"):n.parentElement.classList.add("active"))})}}menuDropdown();